package LCS0;

import java.io.BufferedReader;
import java.util.Arrays;

/*
abababab
bcbb













*/


public class Main {


    static class LCS_DYNAMIC_ALGO {
        // 50000 x 50000
        //32767
        static int lcs(String a, String b, int m, int n) {
            short[][] matrix = new short[m + 1][n + 1];
            for (short[] matrixShort : matrix) {
                Arrays.fill(matrixShort, (short) -32767);
            }

            for (int i = 0; i <= m; i++) {
                for (int j = 0; j <= n; j++) {
                    if (i == 0 || j == 0)
                        matrix[i][j] = -32767;
                    else if (a.charAt(i - 1) == b.charAt(j - 1))
                        matrix[i][j] = (short) (matrix[i - 1][j - 1] + 1);
                    else
                        matrix[i][j] = (short) Math.max(matrix[i - 1][j], matrix[i][j - 1]);
                }
            }

            return matrix[m][n] + 32767;


        }
    }

    public static void main(String[] args) throws Exception {
        BufferedReader r = new BufferedReader(new java.io.InputStreamReader(System.in));
        //50000 lowercase Latin letters.
        String a = r.readLine();
        String b = r.readLine();

        int lcs = LCS_DYNAMIC_ALGO.lcs(a, b, a.length(), b.length());
        System.out.println(lcs);
    }

}